import React from 'react';
import Header from './components/Header';
import List from './components/List';
import Navbar from './components/Navbar';
import Search from './components/Search';

function App() {
  return (
    <>
      <Navbar />
      <Header />
      <Search />
      <ImgFeed>
        <List />
      </ImgFeed>
    </>
  );
}

export default App;
